import React from 'react';
import { NextSeo } from 'next-seo';
import App from './App';

const description = `The #1 Source of RSS Feeds. Finally, follow websites via RSS feeds the way you want to.
  Simply enter the URL of the website you would like to get a feed from.
  Most websites and social networks supported.`;

export default function LandingPage() {
    return (
        <>
            <NextSeo
                {...{
                    description,
                }}
            />
            <App />
        </>
    );
}
